import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import ResultTable from './ResultTable';
import { useDeleteResult } from '../hooks/deleteResult';

export default function ResultView() {
    const [resultId, setResultId] = useState('');
    const deleteResult = useDeleteResult();

    const handleDelete = () => {
        // Call the deleteResult function passing the resultId as a parameter
        if (resultId) {
            deleteResult(resultId);
        } else {
            console.log('result id not provided');
        }
    };

    const handleInputChange = (event) => {
        setResultId(event.target.value);
    };

    return (
        <div className="container">
            <ResultTable />

            <div className="start">
                <Link className='btn' to={'/'}>Back to Start</Link>
            </div>

            <div className="delete-result">
                <input
                    type="text"
                    value={resultId}
                    onChange={handleInputChange}
                    placeholder="Enter Result ID"
                />
                <button onClick={handleDelete}>Delete Result</button>
            </div>
        </div>
    );
}
